    <Layout className="layout">
        <MyHeader/>
        <MyContent>
            {props.children}
        </MyContent>
        <MyFooter/>
        <style jsx>
            {
                `#components-layout-demo-top .logo {
                    width: 120px;
                    height: 31px;
                    margin: 16px 24px 16px 0;
                    float: left;
                  }`
            }
            </style>
    </Layout>
)

export default MyLayout
